import Menu from './Menu'
import MenuItem from './MenuItem'
import config from '../../../../config'

function Navigation(){
    return ( 
        <Menu>
            <MenuItem title="Nam" to={config.routes.home} icon={null}></MenuItem>
            <MenuItem title="Nữ" to={config.routes.home} icon={null}></MenuItem>
            <MenuItem title="Trẻ em" to={config.routes.home} icon={null}></MenuItem>
        </Menu>  
    )
}

export default Navigation;
